import React from "react";

import { Grid, Stack } from "@mui/material";
import IntroduceText from "../../components/IntroduceText";
import CustomBox from "../../components/CustomBox";
import CustomButton from "../../components/CustomButton";

import station1 from "../../assets/img/aboutus/station1.png";
import station2 from "../../assets/img/aboutus/station2.png";
import station3 from "../../assets/img/aboutus/station3.png";
import station4 from "../../assets/img/aboutus/station4.png";
import bigStation from "../../assets/img/aboutus/bigStation.png";

function StationComponent() {
  return (
    <Grid
      container
      spacing={2}
      justifyContent="center"
      alignItem="center"
      mt={3}
    >
      <Grid item xs={12} lg={12}>
        <IntroduceText firstLine="Photo" secondLine="Gallery" />
      </Grid>
      <Grid item xs={12} lg={12}>
        <Stack
          direction="row"
          justifyContent="center"
          alignItems="center"
          spacing={1}
        >
          <CustomBox>
            <img src={station1} alt="" width="100%" />
          </CustomBox>
          <CustomBox>
            <img src={station2} alt="" width="100%" />
          </CustomBox>
          <CustomBox>
            <img src={station3} alt="" width="100%" />
          </CustomBox>
          <CustomBox>
            <img src={station4} alt="" width="100%" />
          </CustomBox>
        </Stack>
        <CustomBox>
          <img src={bigStation} alt="" width="100%" />
        </CustomBox>
      </Grid>
      <Grid item xs={12} lg={12}>
        <CustomBox>
          <CustomButton text="설치 방법" />
        </CustomBox>
      </Grid>
    </Grid>
  );
}

export default StationComponent;
